import './App.css'
import React, { Component } from "react";
import { CardColumns, Card, Button } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import PlaylistAddIcon from '@material-ui/icons/PlaylistAdd';
import PlaylistAddChecIcon from '@material-ui/icons/PlaylistAddCheck';

export default class DisplayList extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
        };

    }

    render() {
        return (
            <div>
                <Card>
                    <Card.Img variant="top" src={props.song.source} alt={props.song.title} />
                    <Card.Body>
                        <Card.Title>{props.song.title}</Card.Title>
                        <Card.Text>
                            Artist: {props.song.artist}
                        </Card.Text>
                        <Card.Text>
                            Language: {props.song.language}
                        </Card.Text>
                        <Card.Text>
                            Singer: {props.song.singer}
                        </Card.Text>
                    </Card.Body>
                    <Card.Footer>
                        <small className="text-muted">Duration: {Math.floor(props.song.duration / 60)}:{props.song.duration % 60}</small>
                    </Card.Footer>
                </Card>
            </div>
        )
    }
}
